sys_variable_value.value:
(function execute(inputs, outputs) {
  // ... code ...

  // Create a new GlideRecord object for the 'incident' table
  var gr = new GlideRecord('x_64275_spaced_rep_timetable');

  // Query all records in the table
  gr.query();

  // Create an array to hold the records
  var records = [];

  // Loop through the records
  while (gr.next()) {
    // Create an object to represent the current record
    var record = {};

    // Loop through the fields in the record
    for (var field in gr) {
      // Add the field value to the record object
      record[field] = gr.getValue(field);
    }

    // Add the record object to the array
    records.push(record);
  }

  // Convert the array to JSON
  var json = JSON.stringify(records);

  // Output the JSON
  var content_block_static = new GlideRecord("sys_script_include");


  if(content_block_static.get("177de3304753211027670178c26d4337")){
    content_block_static.script= json;

    content_block_static.update();
  }
})(inputs, outputs);

